&quot;The plot thickens as the lesbians of Sweetheart's Mother Lover's Society continue to weave a web of deceit. Nubian goddess Alia revenge fucks Magdalene's long-suffering girlfriend Madison, while Magdalene seeks help for her sex addiction with therapist Sydni. The tortured older woman recounts a secret tryst with a beautiful blonde teenage lover that set the stage for her addiction to younger women. But Magdalene's confessions spell trouble for Sydni, who suspects she and Magdalene share the same lover! Meanwhile, Sydni's patient, all natural brunette newcomer Jasmine Jem, is struggling in a dysfunctional relationship with self-serving manipulator Amber Chase. But therapy can't change the intense hold Amber's ex, (a psychotic Sincerre Lemorre), has over the athletic Amber.&quot;

